import styled from 'styled-components'

const Logo = styled.h1`
    font-size: 30px;
    color: black;
    font-family: 'Poiret One';
    font-weight: 700;

    @media screen and (max-width: 600px) {
        font-size: 24px;
    }
`

export default Logo
